import "./App.css";
import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  axios.get("http://localhost:1337/works").then((res) => {
    console.log(res.data);
  });

  return (
    <div className="App">
      <header className="App-header">
        <p>Hello World</p>
      </header>
    </div>
  );
}

export default App;
